import React from "react";

const Card: React.FC<{ car: any }> = ({ car }) => {
  return (
    <div className="card">
      <img src={car.image} alt={car.title} />
      <div className="card-body">
        <h3>{car.title}</h3>
        <p><strong>Price:</strong> {car.price}</p>
        <p><strong>Odometer:</strong> {car.odometer}</p>
        <p><strong>Fuel:</strong> {car.fuel}</p>
        <p><strong>Consumption:</strong> {car.consumption}</p>
        <p><strong>Source:</strong> {car.source}</p>
        <a href={car.link} target="_blank" rel="noopener noreferrer">View</a>
      </div>
    </div>
  );
};

export default Card;
